import { Link } from "react-router-dom";

const CompLogin = () => {


    return(
        <div>
            <h2>LOGIN</h2>
            <Link to="/showDeportivos" className='btn btn-primary mt-2 mtb-2'><i class="fa-solid fa-plus"></i></Link>
        </div>
    );
}

export default CompLogin
